import React from 'react';
import { BrowserRouter as Router, Route, Switch, Routes } from 'react-router-dom';

const App = () => {
  return (
    <Router>
      <div className="app">
        <Header />
        <Routes>
          <Route path="/signup" component={SignUpPage} />
          <Route path="/" component={HomePage} />
        </Routes>
        <Footer />
      </div>
    </Router>
  );
};

export default App;
